import number from '../number'
function placeTspans (string, styles = '', html = '') {
  string.split('').forEach((char, index) => {
    html+=`<tspan x="${index===0 ? 0 : ''}" y="0" style="${styles}">${char}</tspan>`
  })
  return html
}
